options.customCss:
:root {
  /* Colors - Dashboard Harmony */
  --chat--color-primary: hsl(217, 91%, 60%);
  --chat--color-primary-shade-50: hsl(217, 89%, 55%);
  --chat--color-primary-shade-100: hsl(217, 87%, 50%);
  --chat--color-secondary: hsl(142, 76%, 56%);
  --chat--color-secondary-shade-50: hsl(142, 76%, 46%);
  --chat--color-white: hsl(0, 0%, 100%);
  --chat--color-light: hsl(210, 20%, 98%);
  --chat--color-light-shade-50: hsl(217, 20%, 95%);
  --chat--color-light-shade-100: hsl(220, 13%, 91%);
  --chat--color-medium: hsl(217, 20%, 95%);
  --chat--color-dark: hsl(215, 25%, 15%);
  --chat--color-disabled: hsl(215, 16%, 46%);
  --chat--color-typing: hsl(215, 16%, 46%);

  /* Base Layout - Dashboard Aligned */
  --chat--spacing: 1rem;
  --chat--border-radius: 0.5rem;
  --chat--transition-duration: 0.3s;
  --chat--font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Oxygen-Sans, Ubuntu, Cantarell, 'Helvetica Neue', sans-serif;

  /* Window Dimensions */
  --chat--window--width: 400px;
  --chat--window--height: 600px;
  --chat--window--bottom: var(--chat--spacing);
  --chat--window--right: var(--chat--spacing);
  --chat--window--z-index: 9999;
  --chat--window--border: 1px solid hsl(220, 13%, 91%);
  --chat--window--border-radius: var(--chat--border-radius);
  --chat--window--margin-bottom: var(--chat--spacing);

  /* Header Styles - Dashboard Style */
  --chat--header-height: auto;
  --chat--header--padding: 1rem;
  --chat--header--background: hsl(217, 91%, 60%);
  --chat--header--color: hsl(0, 0%, 100%);
  --chat--header--border-top: none;
  --chat--header--border-bottom: 1px solid hsl(217, 87%, 50%);
  --chat--header--border-left: none;
  --chat--header--border-right: none;
  --chat--heading--font-size: 1.125rem;
  --chat--subtitle--font-size: 0.875rem;
  --chat--subtitle--line-height: 1.5;

  /* Message Styles - Clean & Readable */
  --chat--message--font-size: 0.875rem;
  --chat--message--padding: 0.75rem;
  --chat--message--border-radius: var(--chat--border-radius);
  --chat--message-line-height: 1.5;
  --chat--message--margin-bottom: 0.75rem;
  --chat--message--bot--background: hsl(0, 0%, 100%);
  --chat--message--bot--color: hsl(215, 25%, 15%);
  --chat--message--bot--border: 1px solid hsl(220, 13%, 91%);
  --chat--message--user--background: hsl(217, 91%, 60%);
  --chat--message--user--color: hsl(0, 0%, 100%);
  --chat--message--user--border: none;
  --chat--message--pre--background: hsl(217, 20%, 95%);
  --chat--messages-list--padding: var(--chat--spacing);

  /* Toggle Button - Hidden (using wrapper) */
  --chat--toggle--size: 0px;
  --chat--toggle--width: 0px;
  --chat--toggle--height: 0px;
  --chat--toggle--border-radius: 0%;
  --chat--toggle--background: transparent;
  --chat--toggle--hover--background: transparent;
  --chat--toggle--active--background: transparent;
  --chat--toggle--color: transparent;

  /* Input Area - Dashboard Style */
  --chat--textarea--height: 50px;
  --chat--textarea--max-height: 30rem;
  --chat--input--font-size: 0.875rem;
  --chat--input--border: 1px solid hsl(220, 13%, 91%);
  --chat--input--border-radius: var(--chat--border-radius);
  --chat--input--padding: 0.75rem;
  --chat--input--background: hsl(0, 0%, 100%);
  --chat--input--text-color: hsl(215, 25%, 15%);
  --chat--input--line-height: 1.5;
  --chat--input--placeholder--font-size: var(--chat--input--font-size);
  --chat--input--border-active: 2px solid hsl(217, 91%, 60%);
  --chat--input--left--panel--width: 2rem;

  /* Button Styles - Dashboard Harmony */
  --chat--button--color: hsl(0, 0%, 100%);
  --chat--button--background: hsl(217, 91%, 60%);
  --chat--button--padding: 0.5rem 1rem;
  --chat--button--border-radius: var(--chat--border-radius);
  --chat--button--hover--color: hsl(0, 0%, 100%);
  --chat--button--hover--background: hsl(217, 89%, 55%);
  --chat--close--button--color-hover: hsl(217, 91%, 60%);

  /* Send and File Buttons */
  --chat--input--send--button--background: hsl(217, 91%, 60%);
  --chat--input--send--button--color: hsl(0, 0%, 100%);
  --chat--input--send--button--background-hover: hsl(217, 89%, 55%);
  --chat--input--send--button--color-hover: hsl(0, 0%, 100%);
  --chat--input--file--button--background: hsl(210, 40%, 96%);
  --chat--input--file--button--color: hsl(142, 76%, 56%);
  --chat--input--file--button--background-hover: hsl(217, 20%, 95%);
  --chat--input--file--button--color-hover: hsl(142, 76%, 46%);
  --chat--files-spacing: 0.25rem;

  /* Body and Footer */
  --chat--body--background: hsl(210, 20%, 98%);
  --chat--footer--background: hsl(210, 20%, 98%);
  --chat--footer--color: hsl(215, 25%, 15%);
}

/* Global font and styling overrides */
* {
  font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Oxygen-Sans, Ubuntu, Cantarell, 'Helvetica Neue', sans-serif !important;
}

/* Message styling */
.chat-message {
  max-width: 70% !important;
  font-family: inherit !important;
  font-size: 0.875rem !important;
  line-height: 1.5 !important;
}

/* Input styling */
.chat-input, .chat-input input, .chat-input textarea {
  font-family: inherit !important;
  font-size: 0.875rem !important;
}

/* Header styling */
.chat-header, .chat-header h1, .chat-header h2, .chat-header h3 {
  font-family: inherit !important;
  font-weight: 600 !important;
  font-size: 1.125rem !important;
}

/* Button styling */
.chat-button, button {
  font-family: inherit !important;
  font-weight: 500 !important;
  transition: all 0.3s ease !important;
}

/* Remove default toggle button */
.chat-toggle {
  display: none !important;
}

/* Body text */
p, span, div {
  font-family: inherit !important;
}

/* Scrollbar styling */
::-webkit-scrollbar {
  width: 6px;
}

::-webkit-scrollbar-track {
  background: hsl(217, 20%, 95%);
}

::-webkit-scrollbar-thumb {
  background: hsl(217, 91%, 60%);
  border-radius: 3px;
}

::-webkit-scrollbar-thumb:hover {
  background: hsl(217, 89%, 55%);
}

/* Hide the chat header section completely */
.chat-header {
  display: none !important;
}

/* Hide chat intro/welcome section */
.chat-intro, .chat-welcome {
  display: none !important;
}

/* Hide any title or subtitle elements */
.chat-title, .chat-subtitle {
  display: none !important;
}
